<h2><span class="mw-headline" id="Overview">Overview</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=Acinonyx_Prototype&amp;action=edit&amp;section=1" title="Edit section: Overview">edit</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>The Acinonyx Prototype is the newest <a href="/index.php/M6%2B" title="M6+">M6+</a> introduced in Albion Prelude 3.0. It has formidable speed, strong laser recharge and massive frontal firepower. It is the only ship other than <a href="/index.php/M7M" title="M7M">M7Ms</a> able to fire <a href="/index.php/Boarding_Pods" title="Boarding Pods" class="mw-redirect">boarding pods</a>.
</p>
<h2><span class="mw-headline" id="Background">Background</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=Acinonyx_Prototype&amp;action=edit&amp;section=2" title="Edit section: Background">edit</a><span class="mw-editsection-bracket">]</span></span></h2>
<h3><span class="mw-headline" id="Encyclopedia_Entry">Encyclopedia Entry</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=Acinonyx_Prototype&amp;action=edit&amp;section=3" title="Edit section: Encyclopedia Entry">edit</a><span class="mw-editsection-bracket">]</span></span></h3>
<p>This unique ship was custom built to act as a testbed for newly developed technologies. It was designed completely from scratch to incorporate Ho t'Sh't's prototype Matter/Antimatter engine. Equipped with expanded laser generators for weapons testing and missile systems, which have been modified to launch boarding pods, the Acinonyx Prototype is a force to be reckoned with.
</p>
<h2><span class="mw-headline" id="Physical_Characteristics">Physical Characteristics</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=Acinonyx_Prototype&amp;action=edit&amp;section=4" title="Edit section: Physical Characteristics">edit</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>The Acinonyx resembles a Terran ship, except with typical Split modifications. It is essentially a catamaran, with two symmetrical hulls joined together by the cockpit. The main guns are located immediately in front of the cockpit, and spin like a minigun when fired. The ship is the typical Split rust-red color with yellow lighting.
</p>
<h2><span class="mw-headline" id="Combat">Combat</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=Acinonyx_Prototype&amp;action=edit&amp;section=5" title="Edit section: Combat">edit</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>The Acinonyx features twelve forward batteries able to fire the high-damage <a href="/index.php/Concussion_Impulse_Generator" title="Concussion Impulse Generator">Concussion Impulse Generator</a> or <a href="/index.php/Ion_Shard_Railgun" title="Ion Shard Railgun">Ion Shard Railgun</a>, with a large energy reserve and powerful generator. Notably, it can fire <a href="/index.php/Hammer_Heavy_Torpedo" title="Hammer Heavy Torpedo">Hammer Heavy Torpedoes</a>, an extremely powerful tool for dealing with large targets, though the ship cannot fire them in barrages like <a href="/index.php/M7M" title="M7M">M7Ms</a> can.
</p><p>Though dangerous from the front, the Acinonyx has only average shielding for its class, and its defensive turrets do not mount any heavy weaponry. However, it can easily outrun any target it cannot outgun.
</p>
