<h2><span class="mw-headline" id="Availability">Availability</span><span class="mw-editsection"><span class="mw-editsection-bracket">[</span><a href="/index.php?title=Acinonyx_Prototype&amp;action=edit&amp;section=7" title="Edit section: Availability">edit</a><span class="mw-editsection-bracket">]</span></span></h2>
<p>This ship is only available as a reward for completing the Shady Business plot. Like the X-Shuttle, it can't be reverse-engineered in a PHQ.
</p>
